INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "獣人族", 44, 27, "ヒヨリ", "人助け、応援", "東山奈央", 16, 155, 2, "人助けが大好き！　前向き格闘娘", 0, 8, 100101, "トゥインクルウィッシュ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ヒューマン", 47, 5, "ユイ", "料理、人間観察", "種田梨沙", 17, 158, 2, "戦闘のサポートが得意な、心優しい少女", 0, 4, 100201, "トゥインクルウィッシュ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "魔族", 46, 12, "レイ", "読書、乗馬、お茶", "早見沙織", 18, 163, 2, "クールで何事にも真っ直ぐな剣士", 0, 1, 100301, "トゥインクルウィッシュ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "ヒューマン", 27, 10, "ミソギ", "いたずら、探検", "諸星すみれ", 9, 128, 5, "探検好きのイタズラっ子", 0, 8, 100401, "リトルリリカル");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "？？？", "獣人族", 40, 25, "マツリ", "ヒーローごっこ", "下田麻美", 12, 146, 8, "ヒーローに憧れる騎士見習いの少女", 0, 11, 100501, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "魔族", 42, 22, "アカリ", "サックス", "浅倉杏美", 13, 150, 7, "甘え上手なみんなの人気者", 0, 11, 100601, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "魔族", 32, 23, "ミヤコ", "プリンを食べること", "雨宮天", 14, 130, 7, "プリン大好きゴースト娘", 0, 1, 100701, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "エルフ", 40, 10, "ユキ", "鏡で自分を見ること", "大空直美", 14, 150, 15, "ボクは誰よりも美しい", 0, 10, 100801, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "魔族", 45, 5, "アンナ", "小説執筆", "髙野麻美", 17, 159, 13, "前世を信じる中二病患者、「疾風の冥姫」", 0, 7, 100901, "トワイライトキャラバン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "獣人族", 42, 22, "マホ", "空想、ぬいぐるみ集め", "内田真礼", 16, 155, 10, "マホマホ王国のプリンセス", 0, 9, 101001, "自警団（カォン）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "ヒューマン", 44, 25, "リノ", "お裁縫", "阿澄佳奈", 15, 156, 3, "人懐っこくてマシンガントークな妹系少女", 0, 8, 101101, "ラビリンス");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "エルフ", 46, 24, "ハツネ", "妹と遊ぶこと、二度寝、昼寝、早寝", "大橋彩香", 17, 156, 6, "みんなのために超能力を使う眠り姫", 0, 12, 101201, "フォレスティエ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "", "魔族", 55, 21, "ナナカ", "読書、魔法", "佳村はるか", 18, 166, 13, "オタク全開な魔法少女", 0, 8, 101301, "トワイライトキャラバン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "test", "獣人族", 41, 3, "カスミ", "読書、推理", "水瀬いのり", 15, 152, 10, "頭脳明晰な美少女名探偵", 0, 11, 101401, "自警団（カォン）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "test", "エルフ", 54, 5, "ミサト", "絵本作り", "國府田マリ子", 21, 165, 6, "母性溢れる優しいみんなの「ミサト先生」", 0, 9, 101501, "フォレスティエ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "魔族", 48, 10, "スズナ", "ファッション", "上坂すみれ", 18, 167, 14, "天真爛漫で人気者のカリスマモデル", 0, 4, 101601, "ルーセント学院");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "獣人族", 53, 7, "カオリ", "踊り、空手", "高森奈津美", 19, 158, 10, "いつでも「なんくるないさ～」な天然娘", 0, 7, 101701, "自警団（カォン）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "魔族", 52, 14, "イオ", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "伊藤静", 23, 162, 14, "多くの男性を魅了する無垢な女教師", 0, 8, 101801, "ルーセント学院");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "獣人族", 21, 3, "ミミ", "かわいいもの集め", "日高里菜", 10, 117, 5, "お歌もにんじんも、ウサギさんも大好き♪", 0, 4, 102001, "リトルリリカル");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "ヒューマン", 40, 9, "クルミ", "観劇、おままごと", "植田佳奈", 12, 150, 9, "泣き虫で臆病な守ってあげたい女の子", 0, 6, 102101, "サレンディア救護院");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "魔族", 40, 22, "ヨリ", "ゲーム全般", "原紗友里", 13, 150, 7, "人見知りであまのじゃくな女の子", 0, 11, 102201, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ヒューマン", 38, 10, "アヤネ", "屋内でできる遊び", "芹澤優", 14, 148, 9, "ぷうきちといつも一緒！", 0, 5, 102301, "サレンディア救護院");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "ヒューマン", 43, 12, "スズメ", "ご奉仕", "悠木碧", 15, 154, 9, "お嬢さまのためにがんばるドジっ娘メイド", 0, 12, 102501, "サレンディア救護院");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "test", "獣人族", 42, 1, "リン", "あんパン", "小岩井ことり", 17, 144, 11, "遊びと睡眠が何より大事なぐうたら娘", 0, 1, 102601, "牧場（エリザベスパーク）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "魔族", 43, 30, "エリコ", "実験、裁縫、料理", "橋本ちなみ", 16, 154, 13, "運命の相手に一途すぎる乙女", 0, 7, 102701, "トワイライトキャラバン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "エルフ", 43, 4, "サレン", "経営、お茶会", "堀江由衣", 17, 156, 9, "救護院を経営する優しい庶民派お嬢様", 0, 10, 102801, "サレンディア救護院");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "ヒューマン", 40, 24, "ノゾミ", "舞台鑑賞、ダンス", "日笠陽子", 17, 157, 4, "歌って踊れる大人気アイドル", 0, 1, 102901, "カルミナ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ヒューマン", 51, 31, "ニノン", "忍法開発", "佐藤聡美", 16, 163, 15, "トーゴクの神秘、オシエテクダサイ！", 0, 8, 103001, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "魔族", 42, 22, "シノブ", "占い", "大坪由佳", 18, 157, 7, "占いが得意な霊能少女", 0, 12, 103101, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "この私とともにいる限り、\nお金に不自由はさせませんわ！", "ヒューマン", 45, 12, "アキノ", "慈善事業", "松嵜麗", 18, 157, 12, "一人前の商人を目指すパワフルお嬢様", 0, 3, 103201, "メルクリウス財団");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "ヒューマン", 35, 3, "マヒル", "漫才", "新田恵海", 20, 142, 11, "みんなを笑顔にするお笑い牧場主", 0, 3, 103301, "牧場（エリザベスパーク）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "エルフ", 55, 16, "ユカリ", "ウインドーショッピング", "今井麻美", 22, 164, 12, "純情でほっとけない大人の女性", 0, 3, 103401, "メルクリウス財団");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "test", "エルフ", 21, 2, "キョウカ", "お勉強", "小倉唯", 8, 118, 5, "礼儀正しくしっかり者のちびっ子優等生", 0, 2, 103601, "リトルリリカル");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "test", "ヒューマン", 43, 11, "トモ", "剣術、年長者をからかう", "茅原実里", 13, 149, 8, "義理堅くてからかい好きな剣術少女", 0, 8, 103701, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "獣人族", 40, 3, "シオリ", "読書、お散歩", "小清水亜美", 14, 153, 11, "読書が趣味の病弱少女", 0, 11, 103801, "牧場（エリザベスパーク）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "エルフ", 44, 6, "アオイ", "友達作りのイメトレ", "花澤香菜", 13, 158, 6, "「友達」に憧れる、エルフの森の女の子", 0, 6, 104001, "フォレスティエ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "ヒューマン", 46, 3, "チカ", "各種楽器", "福原綾香", 17, 163, 4, "人々を守るために歌う、唱喚士の少女", 0, 6, 104201, "カルミナ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "獣人族", 54, 9, "マコト", "お菓子作り", "小松未可子", 17, 168, 10, "男勝りで情に厚いワイルド娘", 0, 8, 104301, "自警団（カォン）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "test", "魔族", 50, 5, "イリヤ", "世界征服", "丹下桜", "??", 172, 7, "かつては夜を支配した最強の吸血鬼", 0, 5, 104401, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "ヒューマン", 49, 19, "クウカ", "小説を読むこと", "長妻樹里", 18, 157, 15, "妄想大好き！　ほんとは照れ屋な女の子", 0, 11, 104501, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "獣人族", 48, 1, "タマキ", "猫とたわむれること", "沼倉愛美", 18, 158, 12, "弱きを助け強きをくじく猫娘", 0, 3, 104601, "メルクリウス財団");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "？？？", "ヒューマン", 50, 25, "ジュン", "格闘技、湯浴み", "川澄綾子", 25, 171, 8, "素顔を見せない冷静沈着な女性騎士", 0, 10, 104701, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ヒューマン", 49, 11, "ミフユ", "傭兵などのアルバイト", "田所あずさ", 20, 163, 12, "仕事も私事も効率優先な傭兵少女", 0, 11, 104801, "メルクリウス財団");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "ヒューマン", 54, 24, "シズル", "家事全般", "生天目仁美", 18, 168, 3, "お姉ちゃんがお世話してあげるからねっ！", 0, 10, 104901, "ラビリンス");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "魔族", 22, 3, "ミサキ", "ファッション誌鑑賞、コスメ集め", "久野美咲", 11, 120, 14, "ちょっとおませな恋に恋する女の子", 0, 1, 105001, "ルーセント学院");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "ヒューマン", 53, 7, "ミツキ", "研究、実験", "三石琴乃", 27, 166, 13, "実験が趣味の危険な科学者", 0, 3, 105101, "トワイライトキャラバン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "獣人族", 100, 14, "リマ", "毛繕い、お喋り", "徳井青空", 18, 150, 11, "乙女チックなもふもふアニマル", 0, 3, 105201, "牧場（エリザベスパーク）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "ヒューマン", 33, 28, "モニカ", "お菓子屋通い", "辻あゆみ", 18, 140, 15, "見た目も中身もお子ちゃまな異国の軍人", 0, 7, 105301, "ヴァイスフリューゲル　ランドソル支部");
