INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "ヒューマン", 45, 10, "ジータ", "冒険、おしゃべり", "金元寿子", 17, 156, "", "空への冒険を夢見る騎空士の少女", 0, 3, 105701, "？？？");
