INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "ヒューマン", 43, 12, "スズメ（サマー）", "ご奉仕", "悠木碧", 15, 154, 9, "お嬢さまのためにがんばるドジっ娘メイド", 0, 12, 107701, "サレンディア救護院");
