INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "獣人族", 48, 1, "タマキ（サマー）", "猫とたわむれること", "沼倉愛美", 18, 158, 12, "弱きを助け強きをくじく猫娘", 0, 3, 107901, "メルクリウス財団");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ヒューマン", 49, 11, "ミフユ（サマー）", "傭兵などのアルバイト", "田所あずさ", 20, 163, 12, "仕事も私事も効率優先な傭兵少女", 0, 11, 108001, "メルクリウス財団");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "魔族", 42, 22, "シノブ（ハロウィン）", "占い", "大坪由佳", 18, 157, 7, "占いが得意な霊能少女", 0, 12, 108101, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "魔族", 32, 23, "ミヤコ（ハロウィン）", "プリンを食べること", "雨宮天", 14, 130, 7, "プリン大好きゴースト娘", 0, 1, 108201, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "魔族", 22, 3, "ミサキ（ハロウィン）", "ファッション誌鑑賞、コスメ集め", "久野美咲", 11, 120, 14, "ちょっとおませな恋に恋する女の子", 0, 1, 108301, "ルーセント学院");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "ヒューマン", 46, 3, "チカ（クリスマス）", "各種楽器", "福原綾香", 17, 163, 4, "人々を守るために歌う、唱喚士の少女", 0, 6, 108401, "カルミナ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "ヒューマン", 40, 9, "クルミ（クリスマス）", "観劇、おままごと", "植田佳奈", 12, 150, 9, "泣き虫で臆病な守ってあげたい女の子", 0, 6, 108501, "サレンディア救護院");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ヒューマン", 38, 10, "アヤネ（クリスマス）", "屋内でできる遊び", "芹澤優", 14, 148, 9, "ぷうきちといつも一緒！", 0, 5, 108601, "サレンディア救護院");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("A", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "獣人族", 44, 27, "ヒヨリ（ニューイヤー）", "人助け、応援", "東山奈央", 16, 155, 2, "人助けが大好き！　前向き格闘娘", 0, 8, 108701, "トゥインクルウィッシュ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ヒューマン", 47, 5, "ユイ（ニューイヤー）", "料理、人間観察", "種田梨沙", 17, 158, 2, "戦闘のサポートが得意な、心優しい少女", 0, 4, 108801, "トゥインクルウィッシュ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "魔族", 46, 12, "レイ（ニューイヤー）", "読書、乗馬、お茶", "早見沙織", 18, 163, 2, "クールで何事にも真っ直ぐな剣士", 0, 1, 108901, "トゥインクルウィッシュ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "魔族", 43, 30, "エリコ（バレンタイン）", "実験、裁縫、料理", "橋本ちなみ", 16, 154, 13, "運命の相手に一途すぎる乙女", 0, 7, 109001, "トワイライトキャラバン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "ヒューマン", 54, 24, "シズル（バレンタイン）", "家事全般", "生天目仁美", 18, 168, 3, "お姉ちゃんがお世話してあげるからねっ！", 0, 10, 109101, "ラビリンス");
