INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "ヒューマン", 45, 4, "ルゥ", "食べること、眠ること", "こやまきみこ", 15, 144, "", "マナリア魔法学院の新入生", 0, 2, 109301, "？？？");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "半人半竜", 67, 3, "グレア", "ピアノ", "福原綾香", 17, 167, "", "人を超越した力を有す心優しい竜姫", 0, 11, 109401, "？？？");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "ヒューマン", 49, 19, "クウカ（オーエド）", "小説を読むこと", "長妻樹里", 18, 157, 15, "妄想大好き！　ほんとは照れ屋な女の子", 0, 11, 109501, "ヴァイスフリューゲル　ランドソル支部");
