INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "獣人族", 42, 22, "マホ（シンデレラ）", "空想、ぬいぐるみ集め", "内田真礼", 16, 155, 10, "マホマホ王国のプリンセス", 0, 9, 116001, "自警団（カォン）");
