INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("AB", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "獣人族", 48, 1, "タマキ（作業服）", "猫とたわむれること", "沼倉愛美", 18, 158, 12, "弱きを助け強きをくじく猫娘", 0, 3, 116801, "メルクリウス財団");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ヒューマン", 49, 11, "ミフユ（作業服）", "傭兵などのアルバイト", "田所あずさ", 20, 163, 12, "仕事も私事も効率優先な傭兵少女", 0, 11, 116901, "メルクリウス財団");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("B", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "魔族", 43, 30, "エリコ（サマー）", "実験、裁縫、料理", "橋本ちなみ", 16, 154, 13, "運命の相手に一途すぎる乙女", 0, 7, 117001, "トワイライトキャラバン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "ヒューマン", 54, 24, "シズル（サマー）", "家事全般", "生天目仁美", 18, 168, 3, "お姉ちゃんがお世話してあげるからねっ！", 0, 10, 117101, "ラビリンス");
