INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("O", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "ヒューマン", 46, 3, "チカ（サマー）", "各種楽器", "福原綾香", 17, 163, 4, "人々を守るために歌う、唱喚士の少女", 0, 6, 117301, "カルミナ");
